import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to a category page to access sort controls
    await page.click('a:has-text("Electronics")');
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Wait for and interact with the sort dropdown
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for products to update after sorting
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot after applying sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sort_applied.png'));

    // Extract product prices to verify sort
    const productPrices = await page.$$eval('.product-price', elements => 
      elements.map(el => {
        const priceText = el.textContent.match(/\$\d+\.\d{2}/)?.[0];
        return priceText ? parseFloat(priceText.replace('$', '')) : 0;
      })
    );

    // Verify prices are sorted in ascending order
    const isSorted = productPrices.every((price, i, arr) => 
      i === 0 || price >= arr[i - 1]
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high)",
      extractedData: {
        productCount: productPrices.length,
        lowestPrice: productPrices[0],
        highestPrice: productPrices[productPrices.length - 1],
        isSorted: isSorted
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
